import React from "react";

const SlotM = (props) =>
{
   // let x= 'üòÑ';
   // let y= 'üòÑ';
  //  let z= 'üëç';
     let x=props.x;
     let y=props.y;
     let z=props.z;

     if((x==y)&&(y==z))
     {
        return (
            <>
                <div className='slot_style'>
                    <h1>
                        {x} {y} {z}
                    </h1>
                    <h1>This is Matching</h1>
                </div>
            </>
        );
     }
     else{
        return (
            <>
                <div className='slot_style'>
                    <h1>
                        {x} {y} {z}
                    </h1>
                    <h1>This is not Matching</h1>
                </div>
            </>
        );
     }

}

export default SlotM;
